valuesArray.string:
var controlId = this.jsonObject.controlId;
var num = this.jsonObject.num;
var columnName = this.jsonObject.columnName;
var tableCoachView;
var columnNum = -1;
if (controlId) {
	tableCoachView = bta.util.getCoachViewByControlId(controlId);  
}
else {
	return bta.util.assertFail("The Table is not found");
}
if (tableCoachView) {
    var headers = tableCoachView.context.element.querySelectorAll("div.datatable-scroll table thead th");
    if (headers.length > 0) {
      for (var i = 0; i < headers.length; i++) {
        var headerText = bta.util.getElementText(headers[i]);
        if (headerText == columnName) {			
          columnNum = i;				
          break;
        }
      }
    }
    if (columnNum == -1) {
   	return bta.util.assertFail("Can't found the column \"" + columnName + "\" in the table");
    }  
	if (columnNum != -1) {
      console.log("Find column name "+columnName+" in col "+columnNum);	
      var rows = tableCoachView.context.element.querySelectorAll("div table tbody tr");
      for (var i = 0; i < rows.length; i++) {
        var cells = rows[i].querySelectorAll("td.dataTableSelectControl, td[role='gridcell']");		
        var textElement = cells[columnNum];
        var actualValue = bta.util.getElementText(textElement);					
        var inputElement = textElement.querySelector("input[type='text']");				
        if (inputElement) {
          actualValue = bta.util.getElementText(inputElement);
        }
        var selElement = textElement.querySelector("select");				
        if (selElement) {
          actualValue = bta.util.getElementText(selElement);
        }
        bta.util.debug("The table column \"" + columnName + "\" row#" + i +" content: " + actualValue);
        if (Number(actualValue) > num){
          console.log("Choose row#"+i);
          var labelElement = cells[0].querySelector("label.checkbox-block");	
          console.log("Find labelElement "+labelElement);	
          labelElement.click();
          break;
        }
      }
    }
}
return bta.util.callback();

